package hash.string.min.window;


import java.util.ArrayList;
import java.util.List;

public class Solution {

    private static final int MAX_ARRAY_LEN = 128;

    public String minWindow(String s, String t) {
        int[] mapT = new int[MAX_ARRAY_LEN];
        int[] mapS = new int[MAX_ARRAY_LEN];
        for (int i = 0; i < t.length(); i++) {
            mapT[t.charAt(i)] ++;
        }
        List<Integer> vecT = new ArrayList<>();
        for (int i = 0; i < MAX_ARRAY_LEN; i++) {
            if (mapT[i] > 0) {
                vecT.add(i);
            }
        }
        int windowBegin = 0;
        String result = "";
        for (int i = 0; i < s.length(); i++) {
            mapS[s.charAt(i)] ++;
            while (windowBegin < i) {
                char beginCh = s.charAt(windowBegin);
                if (mapT[beginCh] == 0) {
                    windowBegin ++;
                } else if (mapS[beginCh] > mapT[beginCh]) {
                    mapS[beginCh]--;
                    windowBegin++;
                } else {
                    break;
                }
            }
            if (isWindowOK(mapS, mapT, vecT)) {
                int newWindowLen = i - windowBegin + 1;
                if ("".equals(result) || result.length() > newWindowLen) {
                    result = s.substring(windowBegin, i + 1);
                }
            }
        }
        return result;
    }

    private boolean isWindowOK(int[] mapS, int[] mapT, List<Integer> vectT) {
        for (int i = 0; i < vectT.size(); i++) {
            if (mapS[vectT.get(i)] < mapT[vectT.get(i)]) {
                return false;
            }
        }
        return true;
    }

    public String minWindow2(String s, String t) {
        int left = 0, right = 0;
        String result = "";
        int cSize = 0;

        int[] window = new int[128];
        int[] needs = new int[128];
        for (char c : t.toCharArray()) {
            if (needs[c] == 0) {
                cSize++;
            }
            needs[c]++;
        }
        int match = 0;
        while (right < s.length()) {
            int c1 = s.charAt(right);
            if (needs[c1] > 0) {
                window[c1]++;
                if (window[c1] == needs[c1]) {
                    match ++;
                }
            }
            right ++;
            while (match == cSize) {
                if ("".equals(result) || right - left < result.length()) {
                    result = s.substring(left, right);
                }
                int c2 = s.charAt(left);
                if (needs[c2] > 0) {
                    window[c2]--;
                    if (window[c2] < needs[c2]) {
                        match --;
                    }
                }
                left ++;
            }
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        String s1 = "ADOBECODEBANC";
        String t1 = "ABC";
        String s = "";
        String t = "";
        System.out.println(s.length());
        System.out.println(t.length());
        System.out.println(solution.minWindow(s, t));
        System.out.println(solution.minWindow2(s, t));
        System.out.println(solution.minWindow2(s1, t1));
    }
}
